import { useEffect } from 'react';


const DUMMY_MEALS = [
  {
    id: "m1",
    name: "tamil Nadu",

    number: 55,
  },
  {
    id: "m2",
    name: "Karnataka",

    number : 63,
  },
  {
    id: "m3",
    name: "maharashtra",

    number: 85,
  },
  {
    id: "m4",
    name: "Kerala",

    number: 56,
  },
];

const AvailableMeals = () => {


  const [message, setMessage] = useState("");

  useEffect(() => {
    //http://ec2-54-205-32-49.compute-1.amazonaws.com:3306/data
